import './footer.css'
import * as React from 'react';
import { loadCSS } from 'fg-loadcss';
import { ThemeProvider, createTheme } from '@mui/material/styles';
import Stack from '@mui/material/Stack';
import Icon from '@mui/material/Icon';
import MdPhone from '@mui/icons-material/Phone';
import Chip from '@mui/material/Chip';
const theme = createTheme({
    components: {
      MuiIcon: {
        styleOverrides: {
          root: {
            // Match 24px = 3 * 2 + 1.125 * 16
            boxSizing: 'content-box',
            padding: 3,
            fontSize: '1.125rem',
          },
        },
      },
    },
  });
  
    function FontAwesomeIconSize() {
    React.useEffect(() => {
      const node = loadCSS(
        'https://use.fontawesome.com/releases/v5.14.0/css/all.css',
        // Inject before JSS
        document.querySelector('#font-awesome-css') || document.head.firstChild,
      );
  
      return () => {
        node.parentNode.removeChild(node);
      };
    }, []);
  
    return (
      <Stack direction="row" spacing={2}>
        <ThemeProvider theme={theme}>
          <Chip icon={<MdPhone />} label="Call me" />
          <Chip icon={<Icon className="fas fa-phone-alt" />} label="Call me" />
        </ThemeProvider>
      </Stack>
    );
  }
function Footer() {
    return (
        <div className="footer">
            <span className='footer-text'>+7 (984) 193 37-92</span>
            <span className='footer-text'>Приморсикй край г. Артём, ул. Достоевского д.64</span>
        </div>
    )
}

export default Footer;
